import Upload from './components/Upload';
import Navbar from './components/Navbar';
import Wallpapers from './components/Wallpapers';
import Footer from './components/Footer';
import Banner from './components/Banner';

import {
  createBrowserRouter,
  Outlet,
  RouterProvider,
} from "react-router-dom";



const Layout=()=>{
  return(
    <>
    <Navbar/>
    <Banner/>
    <Outlet/>
    <Footer/>

    </>
  )
}

const router = createBrowserRouter([
  {
    path: "/",
    element: <Layout/>,
    children:[
      {
        path: "/",
        element:<Wallpapers/>

      },
      {
        path: "/upload",
        element:<Upload/>
      },
      {
        path: "/anime",
        element:<Upload/>
      },
      {
        path: "/movies",
        element:<Upload/>
      },
      {
        path: "/nature",
        element:<Upload/>
      },
      {
        path: "/cyberpunk",
        element:<Upload/>
      },
      {
        path: "/cars",
        element:<Upload/>
      },
      {
        path: "/others",
        element:<Upload/>
      }
    ]
  },
]);



function App() {
  return (
    <div className='flex bg-black justify-center' >
      <div className='w-9/12 '>

      <RouterProvider router={router} />

      </div>


    </div>
  );
}

export default App;
